        "caption": "<!DOCTYPE html>\n<html>\n<head>\n<title>Table with Caption Example</title>\n</head>\n<body>\n<h1>Table with Caption Example</h1>\n<table>\n<caption>Monthly Expenses</caption>\n<thead>\n<tr>\n<th>Category</th>\n<th>Amount (USD)</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Rent</td>\n<td>1000</td>\n</tr>\n<tr>\n<td>Utilities</td>\n<td>150</td>\n</tr>\n<!-- More table rows -->\n</tbody>\n</table>\n</body>\n</html>\n",
        "col": "<!DOCTYPE html>\n<html>\n<head>\n<title>Col Element Example</title>\n</head>\n<body>\n<h1>Col Element Example</h1>\n<table>\n<colgroup>\n<col style='background-color: lightblue;'>\n<col span='2' style='background-color: lightgreen;'>\n</colgroup>\n<thead>\n<tr>\n<th>Column 1</th>\n<th>Column 2</th>\n<th>Column 3</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Data 1</td>\n<td>Data 2</td>\n<td>Data 3</td>\n</tr>\n<!-- More table rows -->\n</tbody>\n</table>\n</body>\n</html>\n",
