        "tfoot": "<!DOCTYPE html>\n<html>\n<head>\n<title>Elegant Table with TFOOT</title>\n<style>\nbody {\nfont-family: Arial, sans-serif;\n}\ntable {\nborder-collapse: collapse;\nwidth: 100%;\nmax-width: 600px;\nmargin: 0 auto;\nborder: 1px solid #ddd;\n}\nth, td {\nborder: 1px solid #ddd;\npadding: 10px;\ntext-align: left;\n}\nth {\nbackground-color: #f2f2f2;\n}\ntr:nth-child(even) {\nbackground-color: #f9f9f9;\n}\ncaption {\nfont-size: 1.5rem;\nfont-weight: bold;\nmargin-bottom: 10px;\n}\ntfoot {\nfont-weight: bold;\nbackground-color: #f2f2f2;\n}\ntfoot td {\ntext-align: right;\n}\n</style>\n</head>\n<body>\n<h1>Elegant Table with TFOOT</h1>\n<table>\n<caption>Monthly Expenses</caption>\n<thead>\n<tr>\n<th>Date</th>\n<th>Category</th>\n<th>Amount (USD)</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>2023-07-01</td>\n<td>Rent</td>\n<td>1000</td>\n</tr>\n<tr>\n<td>2023-07-05</td>\n<td>Groceries</td>\n<td>150</td>\n</tr>\n<tr>\n<td>2023-07-15</td>\n<td>Utilities</td>\n<td>200</td>\n</tr>\n<!-- More table rows -->\n</tbody>\n<tfoot>\n<tr>\n<td colspan='2'>Total</td>\n<td>1350</td>\n</tr>\n</tfoot>\n</table>\n</body>\n</html>\n",
        "th": "<!DOCTYPE html>\n<html>\n<head>\n<title>Elegant TH Example</title>\n<style>\nbody {\nfont-family: Arial, sans-serif;\n}\ntable {\nborder-collapse: collapse;\nwidth: 100%;\nmax-width: 600px;\nmargin: 0 auto;\nborder: 1px solid #ddd;\n}\nth, td {\nborder: 1px solid #ddd;\npadding: 10px;\ntext-align: left;\n}\nth {\nbackground-color: #f2f2f2;\nfont-weight: bold;\ntext-transform: uppercase;\nletter-spacing: 1px;\n}\ntr:nth-child(even) {\nbackground-color: #f9f9f9;\n}\ncaption {\nfont-size: 1.5rem;\nfont-weight: bold;\nmargin-bottom: 10px;\n}\n</style>\n</head>\n<body>\n<h1>Elegant TH Example</h1>\n<table>\n<caption>Monthly Expenses</caption>\n<thead>\n<tr>\n<th>Date</th>\n<th>Category</th>\n<th>Amount (USD)</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>2023-07-01</td>\n<td>Rent</td>\n<td>1000</td>\n</tr>\n<tr>\n<td>2023-07-05</td>\n<td>Groceries</td>\n<td>150</td>\n</tr>\n<tr>\n<td>2023-07-15</td>\n<td>Utilities</td>\n<td>200</td>\n</tr>\n<!-- More table rows -->\n</tbody>\n</table>\n</body>\n</html>\n",
